// change background for navbar when scrolling down
$(function () {
  $(document).scroll(function () {
    var $nav = $(".fixed-top");
    $nav.toggleClass('scrolled', $(this).scrollTop() > $nav.height());
  }); // handle links with @href started with '#' only

  $(document).on('click', 'a[href^="#"]', function (e) {
    // target element id
    var id = $(this).attr('href'); // target element

    var $id = $(id);

    if ($id.length === 0) {
      return;
    } // prevent standard hash navigation (avoid blinking in IE)


    e.preventDefault(); // top position relative to the document

    var pos = $id.offset().top - 50; // animated top scrolling

    $('body, html').animate({
      scrollTop: pos
    }).offset();
  });
  $('.nav-link').click(function () {
    var $this = $(this);

    if ($this.hasClass('active')) {
      $this.removeClass('active');
    } else {
      $this.addClass('active');
    }
  });
  $('.gallery-list-item').click(function () {
    var value = $(this).attr('data-filter');

    if (value === 'all') {
      $('.filter').show(300);
    } else {
      $('.filter').not('.' + value).hide(300);
      $('.filter').filter('.' + value).show(300);
    }
  });
  $('.gallery-list-item').click(function () {
    $(this).addClass('active-item').siblings().removeClass('active-item');
  });
  $(document).on('click', '[data-toggle="lightbox"]', function (event) {
    event.preventDefault();
    $(this).ekkoLightbox();
  });
  var btn = $('#button');
  $(window).scroll(function () {
    if ($(window).scrollTop() > 300) {
      btn.addClass('show');
    } else {
      btn.removeClass('show');
    }
  });
  btn.on('click', function (e) {
    e.preventDefault();
    $('html, body').animate({
      scrollTop: 0
    }, '300');
  });
  $(document).on('click', '.navbar-collapse', function (e) {
    if ($(e.target).is('a')) {
      $(this).collapse('hide');
    }
  });
  $(document).on('click', '.deleteCategory', function () {
    var categoryId = $(this).attr('data-categoryid');
    $('#modelToDeleteId').val(categoryId);
    $('#deleteModal').modal('show');
  });
  $(document).on('click', '.editCategory', function () {
    var categoryName = $(this).attr('data-categoryname');
    var categoryId = $(this).attr('data-categoryid');
    $('#modelToEditName').val(categoryName);
    $('#modelToEditId').val(categoryId);
    $('#editModal').modal('show');
  });
});

